import React from 'react';
import { Route } from "react-router-dom";
import HomePage from "../Pages/HomePage";


function App() {
  return (
      <div>
        <div className = "container">
            <Route path="/" component={HomePage}></Route>
        </div>
      </div>
  );
}

export default App;
